        private string GetColor(DrawType drawType, ColorUI color, bool wasVoted)
        {
            MethodInfo methodToInvoke = this.GetType().GetMethod("Get" + drawType.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

            object[] parametersInvoke = { color, wasVoted };

            var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
            return returnStringColor;
        }
